INSERT INTO `cproject` VALUES
(1,'Heaven','The Heaven Beni Haoua','Venez d√©couvrir \"The Heaven\", l√† o√π chaque jour est un r√™ve √©veill√©. Pour ceux qui recherchent l\'exclusivit√©, le confort et l\'√©l√©gance, ne cherchez pas plus loin. Votre futur chez-vous vous attend.','<h2>La R&eacute;sidence &quot;The Heaven&quot; : Votre Paradis Sur Terre</h2>\r\n\r\n<p>Nich&eacute;e au c&oelig;ur de Beni Haoua, Chlef, la r&eacute;sidence baln&eacute;aire &quot;The Heaven&quot; est une &eacute;vasion m&eacute;diterran&eacute;enne qui vous promet une exp&eacute;rience de vie in&eacute;gal&eacute;e. Cette r&eacute;sidence, v&eacute;ritable coin de paradis, est adoss&eacute;e &agrave; une plage priv&eacute;e majestueuse s&#39;&eacute;tendant sur 600 m&egrave;tres, vous offrant un acc&egrave;s direct aux caresses du sable fin et aux embruns rafra&icirc;chissants de la mer.</p>\r\n\r\n<p>S&#39;&eacute;talant sur une superficie impressionnante de 18 hectares, &quot;The Heaven&quot; n&#39;est pas seulement un lieu de r&eacute;sidence, c&#39;est une communaut&eacute; florissante. Avec 240 villas de luxe et 240 appartements aux designs diversifi&eacute;s, chacun trouvera son nid douillet.</p>\r\n\r\n<p>Les amoureux du shopping seront s&eacute;duits par le centre commercial au c&oelig;ur de la r&eacute;sidence, proposant une panoplie de boutiques pour r&eacute;pondre &agrave; toutes vos envies. Pour les adeptes de divertissements, un aquapark dernier cri promet des journ&eacute;es ensoleill&eacute;es pleines de rires et de sensations fortes. Les passionn&eacute;s de sport et de bien-&ecirc;tre ne sont pas en reste avec une salle de gym haut de gamme.</p>\r\n\r\n<p>Votre palette culinaire sera en &eacute;bullition avec une vari&eacute;t&eacute; de restaurants offrant une cuisine raffin&eacute;e aux saveurs du monde. Les soir&eacute;es d&#39;&eacute;t&eacute; &agrave; &quot;The Heaven&quot; sont un spectacle en soi. Entre animations &agrave; la plage, soir&eacute;es th&eacute;matiques et une ambiance familiale m&eacute;diterran&eacute;enne, vos &eacute;t&eacute;s seront synonymes de festivit&eacute;s.</p>\r\n\r\n<p>La s&eacute;curit&eacute; est au c&oelig;ur de nos pr&eacute;occupations. La r&eacute;sidence est enti&egrave;rement cl&ocirc;tur&eacute;e et b&eacute;n&eacute;ficie d&#39;un syst&egrave;me de s&eacute;curit&eacute; moderne pour assurer la s&eacute;r&eacute;nit&eacute; de ses habitants.</p>\r\n\r\n<p>Enfin, que vous arriviez de la vibrante capitale Alger ou de son a&eacute;roport international, en seulement 60 minutes, les portes du paradis s&#39;ouvriront &agrave; vous.</p>\r\n\r\n<p>Venez d&eacute;couvrir &quot;The Heaven&quot;, l&agrave; o&ugrave; chaque jour est un r&ecirc;ve &eacute;veill&eacute;. Pour ceux qui recherchent l&#39;exclusivit&eacute;, le confort et l&#39;&eacute;l&eacute;gance, ne cherchez pas plus loin. Votre futur chez-vous vous attend.</p>\r\n\r\n<p>&nbsp;</p>','amenties-3-64e71e489a5f8.webp','aproposaccueil-64e71febe6cb0.jpg','Beni haoua, Chlef','.','The-heaven',1,'Jubail-Island-Development-Progress-March-2023-64e71febe784e.mp4');
/*!40000 ALTER TABLE `cproject` ENABLE KEYS */;
UNLOCK TABLES;

